import './App.css';
import ShopState from './components/context/ShopContext/ShopState';
import Shop from './components/Shop/Shop';
import Navbar from './components/layout/navbar/Navbar';
import React, {BrowserRouter as Router, Route, Switch} from 'react';
import ShopItem from './components/Shop/ShopItem/ShopItem';

const App = () => {
  return (
      <Router>
    <ShopState>
        <div className="App">
          <Navbar />
          <Switch>
            <Route exact path='/' component={Shop} />
            <Route exact path='/shop' component={Shop} />
            <Route exact path='/shop/:itemid' render={(props) => (
              <ShopItem />
            )}/>
          </Switch>
        </div>
    </ShopState>
      </Router>
  );
}

export default App;
